import "./App.css";
import data from "./babyNamesData.json";

function App() {
  return data.map((baby) =>
    baby.sex === "m" ? (
      <p className="babyBoy">{baby.name}</p>
    ) : (
      <span className="babyGirl">{baby.name}</span>
    )
  );
}

export default App;
